Final - No. 20 Jennies 74, Lincoln 45. 
Central Missouri is a win a way from their 2nd MIAA title in 3 years at 21-4, 15-1 MIAA. 
@mmsskaggs and @moflem22  get career win No. 100 as Jennies.

The Jennies control their own fate for an MIAA title and the No. 1 seed in the conference tournament following a 75-65 win over Nebraska-Kearney. 
@moflem22 goes for 24 points on senior night.
@mmsskaggs adds 21. 
@nijacollier24 chips in 12 points.
UCM knocked down eight threes.

